export const SearchBar =
  inject('customerServicesMenuStore')
    (observer((props) => {

      return (
        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
          <PageHeader>Customer Services Enquiry</PageHeader>
          <SearchBox />
        </div>
      )

    }))
